import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { Loader } from "@googlemaps/js-api-loader";
import "./RestaurantResults.css";

const RestaurantResults = () => {
  const [restaurants, setRestaurants] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [map, setMap] = useState(null);
  const location = useLocation();
  const navigate = useNavigate();
  const { searchLocation } = location.state || {};

  useEffect(() => {
    if (!searchLocation) {
      navigate("/");
      return;
    }

    const loadMapAndSearchRestaurants = async () => {
      try {
        // Initialize the loader
        const loader = new Loader({
          apiKey: process.env.REACT_APP_GOOGLE_MAPS_API_KEY,
          version: "weekly",
          libraries: ["places"],
        });

        // Load Google Maps
        const google = await loader.load();

        // Convert coordinates to proper Google Maps LatLng object
        const coordinates = new google.maps.LatLng(
          searchLocation.coordinates.lat,
          searchLocation.coordinates.lng
        );

        // Create map instance
        const mapInstance = new google.maps.Map(document.getElementById("map"), {
          center: coordinates,
          zoom: 14,
        });
        setMap(mapInstance);

        // Create PlacesService after map is initialized
        const service = new google.maps.places.PlacesService(mapInstance);

        // Create request object
        const request = {
          location: coordinates,
          radius: 5000,
          type: ["restaurant"],
        };

        // Wrap nearbySearch in a Promise
        const searchNearbyPlaces = () => {
          return new Promise((resolve, reject) => {
            service.nearbySearch(request, (results, status) => {
              if (status === google.maps.places.PlacesServiceStatus.OK) {
                resolve(results);
              } else {
                reject(new Error(`Places search failed: ${status}`));
              }
            });
          });
        };

        // Execute search and handle results
        const results = await searchNearbyPlaces();
        setRestaurants(results);

        // Add markers for each restaurant
        results.forEach((restaurant) => {
          if (restaurant.geometry?.location) {
            // Create marker
            const marker = new google.maps.Marker({
              position: restaurant.geometry.location,
              map: mapInstance,
              title: restaurant.name,
            });

            // Create info window content
            const infowindow = new google.maps.InfoWindow({
              content: `
                <div>
                  <h3>${restaurant.name}</h3>
                  <p>${restaurant.vicinity}</p>
                  <p>Rating: ${
                    restaurant.rating ? `${restaurant.rating} ⭐` : "No rating"
                  }</p>
                </div>
              `,
            });

            // Add click listener to marker
            marker.addListener("click", () => {
              infowindow.open(mapInstance, marker);
            });
          }
        });

        setLoading(false);
      } catch (err) {
        console.error("Error in loadMapAndSearchRestaurants:", err);
        setError(err.message || "Error loading restaurants");
        setLoading(false);
      }
    };

    loadMapAndSearchRestaurants();
  }, [searchLocation, navigate]);

  // Rest of your component render code remains the same
  return (
    <div className="results-page">
      <div className="results-header">
        <button onClick={() => navigate("/")} className="back-button">
          <i className="fas fa-arrow-left"></i> Back to Search
        </button>
        <h1>Restaurants near {searchLocation?.address || "the selected location"}</h1>
      </div>

      <div className="results-container">
        <div id="map" className="map-container"></div>

        <div className="restaurants-list">
          {loading && <div className="loading">Searching for restaurants...</div>}
          {error && <div className="error-message">{error}</div>}

          {!loading &&
            !error &&
            restaurants.map((restaurant) => (
              <div key={restaurant.place_id} className="restaurant-card">
                {restaurant.photos?.[0] && (
                  <img
                    src={restaurant.photos[0].getUrl()}
                    alt={restaurant.name}
                    className="restaurant-image"
                  />
                )}
                <div className="restaurant-info">
                  <h3>{restaurant.name}</h3>
                  <p>{restaurant.vicinity}</p>
                  <div className="restaurant-details">
                    <span className="rating">
                      {restaurant.rating
                        ? `${restaurant.rating} ⭐`
                        : "No rating"}
                    </span>
                    {restaurant.price_level && (
                      <span className="price-level">
                        {"$".repeat(restaurant.price_level)}
                      </span>
                    )}
                  </div>
                  {restaurant.opening_hours && (
                    <p className={`status ${
                      restaurant.opening_hours.isOpen
                        ? restaurant.opening_hours.isOpen()
                          ? "open"
                          : "closed"
                        : "unknown"
                    }`}>
                      {restaurant.opening_hours.isOpen
                        ? restaurant.opening_hours.isOpen()
                          ? "Open Now"
                          : "Closed"
                        : "No Opening Information"}
                    </p>
                  )}
                </div>
              </div>
            ))}
        </div>
      </div>
    </div>
  );
};

export default RestaurantResults;
